import React from 'react';
import './App.css';
import ExpenseEntryItem from './components/ExpenseEntryItem';
import 'bootstrap/dist/css/bootstrap.min.css';

class App extends React.Component {
  constructor() {
    super();
    this.state = [
      { id: 1, animal: "Dog" },
      { id: 2, animal: "Bird" },
      { id: 3, animal: "Cat" },
      { id: 4, animal: "Mouse" },
      { id: 5, animal: "Horse" }
    ];

  }
  render() {
    return(
      <div>
        {this.state.map(item => (
        <ExpenseEntryItem item={item} />
      ))}
      </div>
    )
  }
}

export default App;
